import React from 'react';
import personImage from '../src/assets/avatar.png';
import { AiFillTwitterCircle, AiFillLinkedin, AiFillYoutube } from 'react-icons/ai';
import './Header.css';

const Header = () => {
  return (
    <header className="header-container">
      <div className="profile-picture">
        <img src={personImage} alt="Person" />
      </div>

      <h1 className="name">Izhar Ali</h1>
      <h2 className="job-title">Jr. DevOps Engineer and Designer</h2>

      <p className="description">
        Freelancer providing services for programming and design content needs. Join me down below and let's get
        cracking!
      </p>

      <div className="social-icons">
        <a href="https://twitter.com/" target="_blank" rel="noopener noreferrer">
          <AiFillTwitterCircle />
        </a>
        <a href="https://www.linkedin.com/" target="_blank" rel="noopener noreferrer">
          <AiFillLinkedin />
        </a>
        <a href="https://www.youtube.com/" target="_blank" rel="noopener noreferrer">
          <AiFillYoutube />
        </a>
      </div>

      <div className="buttons">
        <button className="btn btn-contact">Contact</button>
        <button className="btn btn-resume">Resume</button>
      </div>
    </header>
  );
};

export default Header;
